import React from "react";

import { Props } from "./types";
import * as Styled from "./style";

import RocketseatLogo from '../../assets/funkexplode.svg'

const Header = ({}: Props) => {
  return (
    <Styled.MainHeader display={['flex', 'flex', 'flex']}>
      <RocketseatLogo />

      <Styled.NavBar display={['none', 'none', 'flex']}>
          <Styled.Link>
            Nossos artistas
          </Styled.Link>
          <Styled.Link>
            Fique por dentro
          </Styled.Link>
          <Styled.Link>
            Tá chegando
          </Styled.Link>
      </Styled.NavBar>
      <Styled.Btn>
        <a>
          Compre agora
        </a>
      </Styled.Btn>
    </Styled.MainHeader>
  );
};

export default Header;
